  central_runs<-matrix(0,nrow=n0,ncol=ncol(final))
  final<-rbind(final,central_runs)
  #}
  ###################

  if(randomization==F){
   # print("SORD coded (Standard)",quote=FALSE)
    message("SORD coded (Standard)")
    print(final)
  }else{
    mat3<-matrix(,nrow=0,ncol=v)
    rand<-sample(1:nrow(final),nrow(final),replace = FALSE)

    for(m in rand){
      x11<-matrix(,nrow=1,ncol=v)
      x11<-final[m,]
      mat3<-rbind(mat3,x11)
    }
    rownames(mat3)<-NULL
    #print("SORD coded (Randomized)",quote=FALSE)
    message("SORD coded (Randomized)")
    print(mat3)
    final<-mat3


  }

  ############unique value identify
  if(v!=7){
    uq<-c(-b,-1,0,1,b)

    original<-matrix(,length(min_L),ncol=5)

    for (j in 1:length(min_L)){
      for (i in 1:5){
        original[j,i]<-(((max_L[j]-min_L[j])/2)*uq[i])+((min_L[j]+max_L[j])/2)
      }
    }
  }
  ff<-final
  if(v==7){

    min<-t(t(min_L))

    max<-t(t(max_L))

    mid<-matrix(,nrow=0,ncol=1)
    for(i in 1:length(min_L)){
      x<-matrix(,nrow=1,ncol=0)
      x<-(min_L[i]+max_L[i])/2
      mid<-rbind(mid,(x))
    }

    original1<-cbind(min,mid,max)

    uq<-c(-1,0,1)

    s=1
    while(s<=v){

      o<-c(original1[s,])

      ff[which(ff[,s]==0),s]<-o[2]
      ff[which(ff[,s]==-1),s]<-o[1]
      #ff[which(ff[,s]==-b),s]<-o[1]
      ff[which(ff[,s]==1),s]<-o[3]
      # ff[which(ff[,s]==b),s]<-o[5]
      s=s+1
    }
  }
  ####################




  if(v!=7){
    s=1
    while(s<=v){

      o<-c(original[s,])

      ff[which(ff[,s]==0),s]<-o[3]
      ff[which(ff[,s]==-1),s]<-o[2]
      ff[which(ff[,s]==-b),s]<-o[1]
      ff[which(ff[,s]==1),s]<-o[4]
      ff[which(ff[,s]==b),s]<-o[5]
      s=s+1
    }
  }


  ##################

  final<-ff
  #####################
  if(randomization==F){
    #print("SORD original (Standard)",quote=FALSE)
    message("SORD original (Standard)")
    print(final)
  }else{
    #print("SORD original (Randomized)",quote=FALSE)
    message("SORD original (Randomized)")
    print(final)
    final<-mat3


  }
  mat<-final
  #####################full X matrix


  #########################
  p=1
  while(p<=(v)){
    x1<-matrix(,nrow=nrow(mat),ncol=0)
    x1<-(mat[,p])^2
    mat<-cbind(mat,x1)
    p=p+1
  }


  b1=1
  b2=1
  while(b1<(v)){
    b2=b1+1
    while(b2<=(v)){
      mat2<-matrix(,nrow=0,ncol=1)
      mat2<-mat[,(b1)]*mat[,(b2)]
      mat<-cbind(mat,mat2)
      b2=b2+1
    }

    b1=b1+1

  }
  x_matrix<-mat
  ###################################
  ###########
  x_matrix<-cbind(matrix(1,nrow=nrow(x_matrix),ncol=1),x_matrix)
  colnames(x_matrix)<-NULL
  x_prime_x<-t(x_matrix)%*%x_matrix
  moment_mat<-(1/nrow(x_matrix))*x_prime_x
  if(variance==T){
    #print("Moment Matrix",quote=FALSE)
    message("Moment Matrix")
    print(moment_mat)

    ############


    k1=1
    var<-c()
    while(k1<=nrow(x_matrix)){
      V=t(x_matrix[k1,])
      b<-t(V)
      v_y_hat<-V %*%solve(x_prime_x) %*% b
      var<-c(var,v_y_hat)
      k1<-k1+1
    }
    variance_of_esitmated_response<-round(var,digits = 3 )

    print(table(variance_of_esitmated_response))
  }
}else{
